import React from 'react';
import './App.css';
import DashboardComponent from "./Modules/Dashboard/DashboardComponent";


const App=() =>{
  return (
    <div className="App">
      <header className="App-header">
            <DashboardComponent/>
      </header>
    </div>
  );
};

export default App;
